import React from 'react';
import './App.scss';
import Board from './components/Board';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <Grid align-content="center">
        <Board></Board>
      </Grid>
    </div>
  );
}

export default App;
